import React from "react";
import './Item.css';
import 'animate.css'

function Item(props){
    return(
        <div>
        <div className="row">
      <a href="/link"><i class="linkbtn fab fa-staylinked fa-4x" ></i></a>
      </div>
        <div className="title animate__animated animate__zoomIn">
           <a href={props.link}>{props.title}</a>
        </div>
        </div>
    )
}

export default Item;
